import React from "react";

function Card({ cards, onCardClick }) {

  const handleClick = () => {
    console.log(cards)
    // cards.onCardClick(cards);

    // onCardClick(cards); 
  };
  return(
 <section className="elements" > 
 {cards.map((card) => (

    <div onClick={handleClick} className="element" key={card.id}>
        <img className="element__image  element__image_add" src={card.link}  ></img>
            <h3 className="element__title">{card.name}</h3>
            <button name="elementIconLike" type="button" className="element__icon"></button>
            <div name="elementLikes" className="element__likes">{card.likes}</div>
       <button type="button" className="element__delete"></button>
    </div>
  ))} 
</section>
    ) 
}

export default Card;
